import './navbar.css'

function Navbar()
{
    return(
        <>
            <nav>
                <ul className="left">
                    <a href='#'>Portfolio</a>
                    <a href='#'>Resume</a>
                    <a href='#'>Contact</a>
                </ul>
            </nav>
        </>
    )
}

export default Navbar;
